import { Router, Route } from "react-router-dom";
import {Login} from './component/login.jsx'
function App() {
  return (
    <div className="container pt-5">
    const App = () => <div className="App">
      <Router>
        <div>
          <Route exact path="/login" component={Login} />
        </div>
      </Router>
    </div>;
    </div>
  );
}

export default App;
